import React from 'react';
import './App.css';
import Navbar from './components/Navbar/Navbar';
import Hero from './components/Hero/Hero';
import StudentSection from './components/StudentSection/StudentSection';
import Schedule from './components/Schedule/Schedule';
import Contact from './components/Contact/Contact';
import Footer from './components/Footer/Footer';

function App() {
  return (
    <div className="app">
      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <h1>Chào mừng đến với TechKids</h1>
          <p>Nơi khởi đầu sự nghiệp công nghệ của bạn</p>
          <button className="cta-button">Tìm hiểu thêm</button>
        </div>
      </section>

      {/* Feedback Section */}
      <section className="feedback">
        <h2>Phản hồi từ Học viên</h2>
        <div className="feedback-grid">
          {[1, 2, 3, 4].map((item) => (
            <div key={item} className="feedback-card">
              <div className="avatar"></div>
              <p className="feedback-text">Học tập tại TechKids đã giúp tôi có được nền tảng vững chắc để phát triển sự nghiệp</p>
              <p className="student-name">Học viên {item}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Schedule Section */}
      <section className="schedule">
        <h2>Lịch Học</h2>
        <div className="schedule-content">
          <p>Các lớp học được tổ chức linh hoạt, phù hợp với thời gian của học viên</p>
          <button className="schedule-button">Xem lịch học</button>
        </div>
      </section>

      {/* Contact Section */}
      <section className="contact">
        <h2>Liên Hệ Với Chúng Tôi</h2>
        <form className="contact-form">
          <input type="text" placeholder="Họ và tên" />
          <input type="email" placeholder="Email" />
          <textarea placeholder="Tin nhắn"></textarea>
          <button type="submit">Gửi</button>
        </form>
      </section>

      <Navbar /> {/* Thanh điều hướng chính của trang web */}
      <Hero /> {/* Phần hero hiển thị "Chào mừng đến với TechKids" */}
      <StudentSection /> {/* Phần "Phân hệ tư Học viên" hiển thị các khóa học */}
      <Schedule /> {/* Phần "Lịch Học" hiển thị lịch học */}
      <Contact /> {/* Phần "Liên Hệ Với Chúng Tôi" với form liên hệ */}
      <Footer /> {/* Phần footer của trang web */}
    </div>
  );
}

export default App;
